(window.webpackJsonp=window.webpackJsonp||[]).push([[47],{308:function(n,s,a){"use strict";a.r(s),s.default='<p>The top-level <code>output</code> key contains set of options instructing webpack on how and where it should output your bundles, assets and anything else you bundle or load with webpack.</p>\n<h2 id="outputauxiliarycomment"><code>output.auxiliaryComment</code><a href="#outputauxiliarycomment" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code> <code>object</code></p>\n<p>When used in tandem with <a href="#outputlibrary"><code>output.library</code></a> and <a href="#outputlibrarytarget"><code>output.libraryTarget</code></a>, this option allows users to insert comments within the export wrapper. To insert the same comment for each <code>libraryTarget</code> type, set <code>auxiliaryComment</code> to a string:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token string">\'someLibName\'</span><span class="token punctuation">,</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'umd\'</span><span class="token punctuation">,</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'someLibName.js\'</span><span class="token punctuation">,</span>\n    auxiliaryComment<span class="token punctuation">:</span> <span class="token string">\'Test Comment\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>which will yield the following:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span><span class="token keyword">function</span> <span class="token function">webpackUniversalModuleDefinition</span><span class="token punctuation">(</span>root<span class="token punctuation">,</span> factory<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token comment">// Test Comment</span>\n  <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span> <span class="token operator">&#x26;&#x26;</span> <span class="token keyword">typeof</span> module <span class="token operator">===</span> <span class="token string">\'object\'</span><span class="token punctuation">)</span>\n    module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'lodash\'</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token comment">// Test Comment</span>\n  <span class="token keyword">else</span> <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> define <span class="token operator">===</span> <span class="token string">\'function\'</span> <span class="token operator">&#x26;&#x26;</span> define<span class="token punctuation">.</span>amd<span class="token punctuation">)</span>\n    <span class="token function">define</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token string">\'lodash\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> factory<span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token comment">// Test Comment</span>\n  <span class="token keyword">else</span> <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span><span class="token punctuation">)</span>\n    exports<span class="token punctuation">[</span><span class="token string">\'someLibName\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'lodash\'</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token comment">// Test Comment</span>\n  <span class="token keyword">else</span>\n    root<span class="token punctuation">[</span><span class="token string">\'someLibName\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span>root<span class="token punctuation">[</span><span class="token string">\'_\'</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>__WEBPACK_EXTERNAL_MODULE_1__<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token comment">// ...</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>For fine-grained control over each <code>libraryTarget</code> comment, pass an object:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    <span class="token comment">//...</span>\n    auxiliaryComment<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n      root<span class="token punctuation">:</span> <span class="token string">\'Root Comment\'</span><span class="token punctuation">,</span>\n      commonjs<span class="token punctuation">:</span> <span class="token string">\'CommonJS Comment\'</span><span class="token punctuation">,</span>\n      commonjs2<span class="token punctuation">:</span> <span class="token string">\'CommonJS2 Comment\'</span><span class="token punctuation">,</span>\n      amd<span class="token punctuation">:</span> <span class="token string">\'AMD Comment\'</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputchunkfilename"><code>output.chunkFilename</code><a href="#outputchunkfilename" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'[id].js\'</code></p>\n<p>This option determines the name of non-entry chunk files. See <a href="#outputfilename"><code>output.filename</code></a> option for details on the possible values.</p>\n<p>Note that these filenames need to be generated at runtime to send the requests for chunks. Because of this, placeholders like <code>[name]</code> and <code>[chunkhash]</code> need to add a mapping from chunk id to placeholder value to the output bundle with the webpack runtime. This increases the size and may invalidate the bundle when placeholder value for any chunk changes.</p>\n<p>By default <code>[id].js</code> is used or a value inferred from <a href="#outputfilename"><code>output.filename</code></a> (<code>[name]</code> is replaced with <code>[id]</code> or <code>[id].</code> is prepended).</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    <span class="token comment">//...</span>\n    chunkFilename<span class="token punctuation">:</span> <span class="token string">\'[id].js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputchunkloadtimeout"><code>output.chunkLoadTimeout</code><a href="#outputchunkloadtimeout" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>number = 120000</code></p>\n<p>Number of milliseconds before chunk request expires. This option is supported since webpack 2.6.0.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    <span class="token comment">//...</span>\n    chunkLoadTimeout<span class="token punctuation">:</span> <span class="token number">30000</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputcrossoriginloading"><code>output.crossOriginLoading</code><a href="#outputcrossoriginloading" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean = false</code> <code>string: \'anonymous\' | \'use-credentials\'</code></p>\n<p>Tells webpack to enable <a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/script#attr-crossorigin">cross-origin</a> loading of chunks. Only takes effect when <a href="/configuration/target/"><code>target</code></a> is set to <code>\'web\'</code>, which uses JSONP for loading on-demand chunks, by adding script tags.</p>\n<ul>\n<li><code>\'anonymous\'</code> - Enable cross-origin loading <strong>without credentials</strong></li>\n<li><code>\'use-credentials\'</code> - Enable cross-origin loading <strong>with credentials</strong></li>\n</ul>\n<h2 id="outputjsonpscripttype"><code>output.jsonpScriptType</code><a href="#outputjsonpscripttype" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'text/javascript\': \'module\' | \'text/javascript\'</code></p>\n<p>Allows customization of <code>type</code> attribute of <code>script</code> tags that webpack injects into the DOM to download async chunks.</p>\n<ul>\n<li><code>\'text/javascript\'</code>: Default <code>type</code> in HTML5 and required for some browsers in HTML4.</li>\n<li><code>\'module\'</code>: Causes the code to be treated as a JavaScript module.</li>\n</ul>\n<h2 id="outputdevtoolfallbackmodulefilenametemplate"><code>output.devtoolFallbackModuleFilenameTemplate</code><a href="#outputdevtoolfallbackmodulefilenametemplate" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code> <code>function (info)</code></p>\n<p>A fallback used when the template string or function above yields duplicates.</p>\n<p>See <a href="#outputdevtoolmodulefilenametemplate"><code>output.devtoolModuleFilenameTemplate</code></a>.</p>\n<h2 id="outputdevtoollinetoline"><code>output.devtoolLineToLine</code><a href="#outputdevtoollinetoline" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean = false</code> <code>object: { test string | RegExp, include string | RegExp, exclude string | RegExp}</code></p>\n<blockquote>\n<p>Avoid using this option as it is <strong>deprecated</strong> and will soon be removed.</p>\n</blockquote>\n<p>Enables line to line mapping for all or some modules. This produces a simple source map where each line of the generated source is mapped to the same line of the original source. This is a performance optimization and should only be used if all input lines match generated lines.</p>\n<p>Pass a boolean to enable or disable this feature for all modules (defaults to <code>false</code>). Use <code>object</code> for granular control, e.g. to enable this feature for all javascript files within a certain directory:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    devtoolLineToLine<span class="token punctuation">:</span> <span class="token punctuation">{</span> test<span class="token punctuation">:</span> <span class="token regex">/\\.js$/</span><span class="token punctuation">,</span> include<span class="token punctuation">:</span> <span class="token string">\'src/utilities\'</span> <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputdevtoolmodulefilenametemplate"><code>output.devtoolModuleFilenameTemplate</code><a href="#outputdevtoolmodulefilenametemplate" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'webpack://[namespace]/[resource-path]?[loaders]\'</code> <code>function (info) => string</code></p>\n<p>This option is only used when <a href="/configuration/devtool"><code>devtool</code></a> uses an options which requires module names.</p>\n<p>Customize the names used in each source map\'s <code>sources</code> array. This can be done by passing a template string or function. For example, when using <code>devtool: \'eval\'</code>.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    devtoolModuleFilenameTemplate<span class="token punctuation">:</span> <span class="token string">\'webpack://[namespace]/[resource-path]?[loaders]\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>The following substitutions are available in template strings (via webpack\'s internal <a href="https://github.com/webpack/webpack/blob/master/lib/ModuleFilenameHelpers.js"><code>ModuleFilenameHelpers</code></a>):</p>\n<table>\n<thead>\n<tr>\n<th>Template</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[absolute-resource-path]<p class="description mobile">The absolute filename</p></p></div></td>\n<td class="description desktop">The absolute filename</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[all-loaders]<p class="description mobile">Automatic and explicit loaders and params up to the name of the first loader</p></p></div></td>\n<td class="description desktop">Automatic and explicit loaders and params up to the name of the first loader</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[hash]<p class="description mobile">The hash of the module identifier</p></p></div></td>\n<td class="description desktop">The hash of the module identifier</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[id]<p class="description mobile">The module identifier</p></p></div></td>\n<td class="description desktop">The module identifier</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[loaders]<p class="description mobile">Explicit loaders and params up to the name of the first loader</p></p></div></td>\n<td class="description desktop">Explicit loaders and params up to the name of the first loader</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[resource]<p class="description mobile">The path used to resolve the file and any query params used on the first loader</p></p></div></td>\n<td class="description desktop">The path used to resolve the file and any query params used on the first loader</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[resource-path]<p class="description mobile">The path used to resolve the file without any query params</p></p></div></td>\n<td class="description desktop">The path used to resolve the file without any query params</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[namespace]<p class="description mobile">The modules namespace. This is usually the library name when building as a library, empty otherwise</p></p></div></td>\n<td class="description desktop">The modules namespace. This is usually the library name when building as a library, empty otherwise</td>\n</tr>\n</tbody>\n</table>\n<p>When using a function, the same options are available camel-cased via the <code>info</code> parameter:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    devtoolModuleFilenameTemplate<span class="token punctuation">:</span> info <span class="token operator">=></span> <span class="token punctuation">{</span>\n      <span class="token keyword">return</span> <span class="token template-string"><span class="token string">`webpack:///</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>info<span class="token punctuation">.</span>resourcePath<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">?</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>info<span class="token punctuation">.</span>loaders<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">`</span></span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>If multiple modules would result in the same name, <a href="#outputdevtoolfallbackmodulefilenametemplate"><code>output.devtoolFallbackModuleFilenameTemplate</code></a> is used instead for these modules.</p>\n<h2 id="outputdevtoolnamespace"><code>output.devtoolNamespace</code><a href="#outputdevtoolnamespace" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code></p>\n<p>This option determines the modules namespace used with the <a href="#outputdevtoolmodulefilenametemplate"><code>output.devtoolModuleFilenameTemplate</code></a>. When not specified, it will default to the value of: <a href="#outputlibrary"><code>output.library</code></a>. It\'s used to prevent source file path collisions in sourcemaps when loading multiple libraries built with webpack.</p>\n<p>For example, if you have 2 libraries, with namespaces <code>library1</code> and <code>library2</code>, which both have a file <code>./src/index.js</code> (with potentially different contents), they will expose these files as <code>webpack://library1/./src/index.js</code> and <code>webpack://library2/./src/index.js</code>.</p>\n<h2 id="outputfilename"><code>output.filename</code><a href="#outputfilename" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code> <code>function (chunkData) => string</code></p>\n<p>This option determines the name of each output bundle. The bundle is written to the directory specified by the <a href="#outputpath"><code>output.path</code></a> option.</p>\n<p>For a single <a href="/configuration/entry-context/#entry"><code>entry</code></a> point, this can be a static name.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'bundle.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>However, when creating multiple bundles via more than one entry point, code splitting, or various plugins, you should use one of the following substitutions to give each bundle a unique name...</p>\n<p>Using entry name:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'[name].bundle.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Using internal chunk id:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'[id].bundle.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Using the unique hash generated for every build:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'[name].[hash].bundle.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Using hashes based on each chunks\' content:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'[chunkhash].bundle.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Using hashes generated for extracted content:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'[contenthash].bundle.css\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Using function to return the filename:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    filename<span class="token punctuation">:</span> <span class="token punctuation">(</span>chunkData<span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n      <span class="token keyword">return</span> chunkData<span class="token punctuation">.</span>chunk<span class="token punctuation">.</span>name <span class="token operator">===</span> <span class="token string">\'main\'</span> <span class="token operator">?</span> <span class="token string">\'[name].js\'</span><span class="token punctuation">:</span> <span class="token string">\'[name]/[name].js\'</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Make sure to read the <a href="/guides/caching">Caching guide</a> for details. There are more steps involved than just setting this option.</p>\n<p>Note this option is called filename but you are still allowed to use something like <code>\'js/[name]/bundle.js\'</code> to create a folder structure.</p>\n<p>Note this option does not affect output files for on-demand-loaded chunks. For these files the <a href="#outputchunkfilename"><code>output.chunkFilename</code></a> option is used. Files created by loaders also aren\'t affected. In this case you would have to try the specific loader\'s available options.</p>\n<p>The following substitutions are available in template strings (via webpack\'s internal <a href="https://github.com/webpack/webpack/blob/master/lib/TemplatedPathPlugin.js"><code>TemplatedPathPlugin</code></a>):</p>\n<table>\n<thead>\n<tr>\n<th>Template</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[hash]<p class="description mobile">The hash of the module identifier</p></p></div></td>\n<td class="description desktop">The hash of the module identifier</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[contenthash]<p class="description mobile">the hash of the content of a file, which is different for each asset</p></p></div></td>\n<td class="description desktop">the hash of the content of a file, which is different for each asset</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[chunkhash]<p class="description mobile">The hash of the chunk content</p></p></div></td>\n<td class="description desktop">The hash of the chunk content</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[name]<p class="description mobile">The module name</p></p></div></td>\n<td class="description desktop">The module name</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[id]<p class="description mobile">The module identifier</p></p></div></td>\n<td class="description desktop">The module identifier</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[query]<p class="description mobile">The module query, i.e., the string following <code>?</code> in the filename</p></p></div></td>\n<td class="description desktop">The module query, i.e., the string following \n<code>?</code>\n in the filename</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[function]<p class="description mobile">The function, which can return filename [string]</p></p></div></td>\n<td class="description desktop">The function, which can return filename \n[\nstring\n]</td>\n</tr>\n</tbody>\n</table>\n<p>The lengths of <code>[hash]</code> and <code>[chunkhash]</code> can be specified using <code>[hash:16]</code> (defaults to 20). Alternatively, specify <a href="#outputhashdigestlength"><code>output.hashDigestLength</code></a> to configure the length globally.</p>\n<p>It is possible to filter out placeholder replacement when you want to use one of the placeholders in the actual file name. For example, to output a file <code>[name].js</code>, you have to escape the <code>[name]</code> placeholder by adding backslashes between the brackets. So that <code>[\\name\\]</code> generates <code>[name]</code> instead of getting replaced with the <code>name</code> of the asset.</p>\n<p>Example: <code>[\\id\\]</code> generates <code>[id]</code> instead of getting replaced with the <code>id</code>.</p>\n<p>If using a function for this option, the function will be passed an object containing the substitutions in the table above.</p>\n<blockquote class="tip">\n<p>When using the <a href="/plugins/extract-text-webpack-plugin"><code>ExtractTextWebpackPlugin</code></a>, use <code>[contenthash]</code> to obtain a hash of the extracted file (neither <code>[hash]</code> nor <code>[chunkhash]</code> work).</p>\n</blockquote>\n<h2 id="outputglobalobject"><code>output.globalObject</code><a href="#outputglobalobject" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'window\'</code></p>\n<p>When targeting a library, especially the <code>libraryTarget</code> is <code>\'umd\'</code>, this option indicates what global object will be used to mount the library. To make UMD build available on both browsers and Node.js, set <code>output.globalObject</code> option to <code>\'this\'</code>.</p>\n<p>For example:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">// ...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token string">\'myLib\'</span><span class="token punctuation">,</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'umd\'</span><span class="token punctuation">,</span>\n    filename<span class="token punctuation">:</span> <span class="token string">\'myLib.js\'</span><span class="token punctuation">,</span>\n    globalObject<span class="token punctuation">:</span> <span class="token string">\'this\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputhashdigest"><code>output.hashDigest</code><a href="#outputhashdigest" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'hex\'</code></p>\n<p>The encoding to use when generating the hash. All encodings from Node.JS\' <a href="https://nodejs.org/api/crypto.html#crypto_hash_digest_encoding"><code>hash.digest</code></a> are supported. Using <code>\'base64\'</code> for filenames might be problematic since it has the character <code>/</code> in its alphabet. Likewise <code>\'latin1\'</code> could contain any character.</p>\n<h2 id="outputhashdigestlength"><code>output.hashDigestLength</code><a href="#outputhashdigestlength" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>number = 20</code></p>\n<p>The prefix length of the hash digest to use.</p>\n<h2 id="outputhashfunction"><code>output.hashFunction</code><a href="#outputhashfunction" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'md4\'</code> <code>function</code></p>\n<p>The hashing algorithm to use. All functions from Node.JS\' <a href="https://nodejs.org/api/crypto.html#crypto_crypto_createhash_algorithm_options"><code>crypto.createHash</code></a> are supported. Since <code>4.0.0-alpha2</code>, the <code>hashFunction</code> can now be a constructor to a custom hash function. You can provide a non-crypto hash function for performance reasons.</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    hashFunction<span class="token punctuation">:</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'metrohash\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>MetroHash64\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Make sure that the hashing function will have <code>update</code> and <code>digest</code> methods available.</p>\n<h2 id="outputhashsalt"><code>output.hashSalt</code><a href="#outputhashsalt" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>An optional salt to update the hash via Node.JS\' <a href="https://nodejs.org/api/crypto.html#crypto_hash_update_data_inputencoding"><code>hash.update</code></a>.</p>\n<h2 id="outputhotupdatechunkfilename"><code>output.hotUpdateChunkFilename</code><a href="#outputhotupdatechunkfilename" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'[id].[hash].hot-update.js\'</code> <code>function (chunkData) => string</code></p>\n<p>Customize the filenames of hot update chunks. See <a href="#outputfilename"><code>output.filename</code></a> option for details on the possible values.</p>\n<p>The only placeholders allowed here are <code>[id]</code> and <code>[hash]</code>, the default being:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    hotUpdateChunkFilename<span class="token punctuation">:</span> <span class="token punctuation">(</span>chunkData<span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n      <span class="token keyword">return</span> <span class="token template-string"><span class="token string">`</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>chunkData<span class="token punctuation">.</span>chunk<span class="token punctuation">.</span>name <span class="token operator">===</span> <span class="token string">\'main\'</span> <span class="token operator">?</span> <span class="token string">\'\'</span> <span class="token punctuation">:</span> <span class="token string">\'[name]/\'</span><span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">[id].[hash].hot-update.js`</span></span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<blockquote class="tip">\n<p>Typically you don\'t need to change <code>output.hotUpdateChunkFilename</code>.</p>\n</blockquote>\n<h2 id="outputhotupdatefunction"><code>output.hotUpdateFunction</code><a href="#outputhotupdatefunction" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code></p>\n<p>Only used when <a href="/configuration/target/"><code>target</code></a> is set to <code>\'web\'</code>, which uses JSONP for loading hot updates.</p>\n<p>A JSONP function used to asynchronously load hot-update chunks.</p>\n<p>For details see <a href="#outputjsonpfunction"><code>output.jsonpFunction</code></a>.</p>\n<h2 id="outputhotupdatemainfilename"><code>output.hotUpdateMainFilename</code><a href="#outputhotupdatemainfilename" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'[hash].hot-update.json\'</code> <code>function</code></p>\n<p>Customize the main hot update filename. <code>[hash]</code> is the only available placeholder.</p>\n<blockquote class="tip">\n<p>Typically you don\'t need to change <code>output.hotUpdateMainFilename</code>.</p>\n</blockquote>\n<h2 id="outputjsonpfunction"><code>output.jsonpFunction</code><a href="#outputjsonpfunction" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'webpackJsonp\'</code></p>\n<p>Only used when <a href="/configuration/target/"><code>target</code></a> is set to <code>\'web\'</code>, which uses JSONP for loading on-demand chunks.</p>\n<p>A JSONP function name used to asynchronously load chunks or join multiple initial chunks (SplitChunksPlugin, AggressiveSplittingPlugin).</p>\n<p>If using the <a href="#outputlibrary"><code>output.library</code></a> option, the library name is automatically concatenated with <code>output.jsonpFunction</code>\'s value.</p>\n<blockquote class="warning">\n<p>If multiple webpack runtimes (from different compilations) are used on the same webpage, there is a risk of conflicts of on-demand chunks in the global namespace.</p>\n</blockquote>\n<p>By default, on-demand chunk\'s output starts with:</p>\n<p><strong>example-on-demand-chunk.js</strong></p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span>window<span class="token punctuation">.</span>webpackJsonp <span class="token operator">=</span> window<span class="token punctuation">.</span>webpackJsonp <span class="token operator">||</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token comment">/* ... */</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>Change <code>output.jsonpFunction</code> for safe usage of multiple webpack runtimes on the same webpage:</p>\n<p><strong>webpack.config.flight-widget.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    jsonpFunction<span class="token punctuation">:</span> <span class="token string">\'wpJsonpFlightsWidget\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>On-demand chunks content would now change to:</p>\n<p><strong>example-on-demand-chunk.js</strong></p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span>window<span class="token punctuation">.</span>wpJsonpFlightsWidget <span class="token operator">=</span> window<span class="token punctuation">.</span>wpJsonpFlightsWidget <span class="token operator">||</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token comment">/* ... */</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputlibrary"><code>output.library</code><a href="#outputlibrary" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code> <code>object</code></p>\n<blockquote class="tip">\n<p>Can be given an <code>object</code> since webpack 3.1.0. Effective for <code>libraryTarget: \'umd\'</code>.</p>\n</blockquote>\n<p>How the value of the <code>output.library</code> is used depends on the value of the <a href="#outputlibrarytarget"><code>output.libraryTarget</code></a> option; please refer to that section for the complete details. Note that the default option for <code>output.libraryTarget</code> is <code>var</code>, so if the following configuration option is used:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token string">\'MyLibrary\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>The variable <code>MyLibrary</code> will be bound with the return value of your entry file, if the resulting output is included as a script tag in an HTML page.</p>\n<blockquote class="warning">\n<p>Note that if an <code>array</code> is provided as an <code>entry</code> point, only the last module in the array will be exposed. If an <code>object</code> is provided, it can be exposed using an <code>array</code> syntax (see <a href="https://github.com/webpack/webpack/tree/master/examples/multi-part-library">this example</a> for details).</p>\n</blockquote>\n<blockquote class="tip">\n<p>Read the <a href="/guides/author-libraries/">authoring libraries guide</a> guide for more information on <code>output.library</code> as well as <code>output.libraryTarget</code>.</p>\n</blockquote>\n<h2 id="outputlibraryexport"><code>output.libraryExport</code><a href="#outputlibraryexport" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string</code> <code>[string]</code></p>\n<p>Configure which module or modules will be exposed via the <code>libraryTarget</code>. It is <code>undefined</code> by default, same behaviour will be applied if you set <code>libraryTarget</code> to an empty string e.g. <code>\'\'</code> it will export the whole (namespace) object. The examples below demonstrate the effect of this config when using <code>libraryTarget: \'var\'</code>.</p>\n<p>The following configurations are supported:</p>\n<p><code>libraryExport: \'default\'</code> - The <strong>default export of your entry point</strong> will be assigned to the library target:</p>\n<pre><code class="hljs language-javascript"><span class="token comment">// if your entry has a default export of `MyDefaultModule`</span>\n<span class="token keyword">var</span> MyDefaultModule <span class="token operator">=</span> _entry_return_<span class="token punctuation">.</span><span class="token keyword">default</span><span class="token punctuation">;</span></code></pre>\n<p><code>libraryExport: \'MyModule\'</code> - The <strong>specified module</strong> will be assigned to the library target:</p>\n<pre><code class="hljs language-javascript"><span class="token keyword">var</span> MyModule <span class="token operator">=</span> _entry_return_<span class="token punctuation">.</span>MyModule<span class="token punctuation">;</span></code></pre>\n<p><code>libraryExport: [\'MyModule\', \'MySubModule\']</code> - The array is interpreted as a <strong>path to a module</strong> to be assigned to the library target:</p>\n<pre><code class="hljs language-javascript"><span class="token keyword">var</span> MySubModule <span class="token operator">=</span> _entry_return_<span class="token punctuation">.</span>MyModule<span class="token punctuation">.</span>MySubModule<span class="token punctuation">;</span></code></pre>\n<p>With the <code>libraryExport</code> configurations specified above, the resulting libraries could be utilized as such:</p>\n<pre><code class="hljs language-javascript">MyDefaultModule<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nMyModule<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nMySubModule<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputlibrarytarget"><code>output.libraryTarget</code><a href="#outputlibrarytarget" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'var\'</code></p>\n<p>Configure how the library will be exposed. Any one of the following options can be used. Please note that this option works in conjunction with the value assigned to <a href="#outputlibrary"><code>output.library</code></a>. For the following examples, it is assumed that this value is configured as <code>MyLibrary</code>.</p>\n<blockquote class="tip">\n<p>Note that <code>_entry_return_</code> in the example code below is the value returned by the entry point. In the bundle itself, it is the output of the function that is generated by webpack from the entry point.</p>\n</blockquote>\n<h3 id="expose-a-variable">Expose a Variable<a href="#expose-a-variable" aria-hidden="true"><span class="icon icon-link"></span></a></h3>\n<p>These options assign the return value of the entry point (e.g. whatever the entry point exported) to the name provided by <code>output.library</code> at whatever scope the bundle was included at.</p>\n<p><code>libraryTarget: \'var\'</code> - (default) When your library is loaded, the <strong>return value of your entry point</strong> will be assigned to a variable:</p>\n<pre><code class="hljs language-javascript"><span class="token keyword">var</span> MyLibrary <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\n<span class="token comment">// In a separate script...</span>\nMyLibrary<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<blockquote class="warning">\n<p>When using this option, an empty <code>output.library</code> will result in no assignment.</p>\n</blockquote>\n<p><code>libraryTarget: \'assign\'</code> - This will generate an implied global which has the potential to reassign an existing value (use with caution).</p>\n<pre><code class="hljs language-javascript">MyLibrary <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span></code></pre>\n<p>Be aware that if <code>MyLibrary</code> isn\'t defined earlier your library will be set in global scope.</p>\n<blockquote class="warning">\n<p>When using this option, an empty <code>output.library</code> will result in a broken output bundle.</p>\n</blockquote>\n<h3 id="expose-via-object-assignment">Expose Via Object Assignment<a href="#expose-via-object-assignment" aria-hidden="true"><span class="icon icon-link"></span></a></h3>\n<p>These options assign the return value of the entry point (e.g. whatever the entry point exported) to a specific object under the name defined by <code>output.library</code>.</p>\n<p>If <code>output.library</code> is not assigned a non-empty string, the default behavior is that all properties returned by the entry point will be assigned to the object as defined for the particular <code>output.libraryTarget</code>, via the following code fragment:</p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span><span class="token keyword">function</span><span class="token punctuation">(</span>e<span class="token punctuation">,</span> a<span class="token punctuation">)</span> <span class="token punctuation">{</span> <span class="token keyword">for</span><span class="token punctuation">(</span><span class="token keyword">var</span> i <span class="token keyword">in</span> a<span class="token punctuation">)</span> <span class="token punctuation">{</span> e<span class="token punctuation">[</span>i<span class="token punctuation">]</span> <span class="token operator">=</span> a<span class="token punctuation">[</span>i<span class="token punctuation">]</span><span class="token punctuation">;</span> <span class="token punctuation">}</span> <span class="token punctuation">}</span><span class="token punctuation">(</span>output<span class="token punctuation">.</span>libraryTarget<span class="token punctuation">,</span> _entry_return_<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<blockquote class="warning">\n<p>Note that not setting a <code>output.library</code> will cause all properties returned by the entry point to be assigned to the given object; there are no checks against existing property names.</p>\n</blockquote>\n<p><code>libraryTarget: "this"</code> - The <strong>return value of your entry point</strong> will be assigned to this under the property named by <code>output.library</code>. The meaning of <code>this</code> is up to you:</p>\n<pre><code class="hljs language-javascript"><span class="token keyword">this</span><span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\n<span class="token comment">// In a separate script...</span>\n<span class="token keyword">this</span><span class="token punctuation">.</span>MyLibrary<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nMyLibrary<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// if this is window</span></code></pre>\n<p><code>libraryTarget: \'window\'</code> - The <strong>return value of your entry point</strong> will be assigned to the <code>window</code> object using the <code>output.library</code> value.</p>\n<pre><code class="hljs language-javascript">window<span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\nwindow<span class="token punctuation">.</span>MyLibrary<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p><code>libraryTarget: \'global\'</code> - The <strong>return value of your entry point</strong> will be assigned to the <code>global</code> object using the <code>output.library</code> value.</p>\n<pre><code class="hljs language-javascript">global<span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\nglobal<span class="token punctuation">.</span>MyLibrary<span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p><code>libraryTarget: \'commonjs\'</code> - The <strong>return value of your entry point</strong> will be assigned to the <code>exports</code> object using the <code>output.library</code> value. As the name implies, this is used in CommonJS environments.</p>\n<pre><code class="hljs language-javascript">exports<span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<h3 id="module-definition-systems">Module Definition Systems<a href="#module-definition-systems" aria-hidden="true"><span class="icon icon-link"></span></a></h3>\n<p>These options will result in a bundle that comes with a more complete header to ensure compatibility with various module systems. The <code>output.library</code> option will take on a different meaning under the following <code>output.libraryTarget</code> options.</p>\n<p><code>libraryTarget: \'commonjs2\'</code> - The <strong>return value of your entry point</strong> will be assigned to the <code>module.exports</code>. As the name implies, this is used in CommonJS environments:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> _entry_return_<span class="token punctuation">;</span>\n\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">doSomething</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>Note that <code>output.library</code> is omitted, thus it is not required for this particular <code>output.libraryTarget</code>.</p>\n<blockquote class="tip">\n<p>Wondering the difference between CommonJS and CommonJS2 is? While they are similar, there are some subtle differences between them that are not usually relevant in the context of webpack. (For further details, please <a href="https://github.com/webpack/webpack/issues/1114">read this issue</a>.)</p>\n</blockquote>\n<p><code>libraryTarget: \'amd\'</code> - This will expose your library as an AMD module.</p>\n<p>AMD modules require that the entry chunk (e.g. the first script loaded by the <code>&#x3C;script></code> tag) be defined with specific properties, such as <code>define</code> and <code>require</code> which is typically provided by RequireJS or any compatible loaders (such as almond). Otherwise, loading the resulting AMD bundle directly will result in an error like <code>define is not defined</code>.</p>\n<p>So, with the following configuration...</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token string">\'MyLibrary\'</span><span class="token punctuation">,</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'amd\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>The generated output will be defined with the name "MyLibrary", i.e.</p>\n<pre><code class="hljs language-javascript"><span class="token function">define</span><span class="token punctuation">(</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> _entry_return_<span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>The bundle can be included as part of a script tag, and the bundle can be invoked like so:</p>\n<pre><code class="hljs language-javascript"><span class="token function">require</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>MyLibrary<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token comment">// Do something with the library...</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>If <code>output.library</code> is undefined, the following is generated instead.</p>\n<pre><code class="hljs language-javascript"><span class="token function">define</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> _entry_return_<span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>This bundle will not work as expected, or not work at all (in the case of the almond loader) if loaded directly with a <code>&#x3C;script></code> tag. It will only work through a RequireJS compatible asynchronous module loader through the actual path to that file, so in this case, the <code>output.path</code> and <code>output.filename</code> may become important for this particular setup if these are exposed directly on the server.</p>\n<p><code>libraryTarget: \'amd-require\'</code> - This packages your output with an immediately-executed AMD <code>require(dependencies, factory)</code> wrapper.</p>\n<p>The <code>\'amd-require\'</code> target allows for the use of AMD dependencies without needing a separate later invocation. As with the <code>\'amd\'</code> target, this depends on the appropriate <a href="https://github.com/amdjs/amdjs-api/blob/master/require.md"><code>require</code> function</a> being available in the environment in which the webpack output is loaded.</p>\n<p>With this target, the library name is ignored.</p>\n<p><code>libraryTarget: \'umd\'</code> - This exposes your library under all the module definitions, allowing it to work with CommonJS, AMD and as global variable. Take a look at the <a href="https://github.com/umdjs/umd">UMD Repository</a> to learn more.</p>\n<p>In this case, you need the <code>library</code> property to name your module:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token string">\'MyLibrary\'</span><span class="token punctuation">,</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'umd\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>And finally the output is:</p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span><span class="token keyword">function</span> <span class="token function">webpackUniversalModuleDefinition</span><span class="token punctuation">(</span>root<span class="token punctuation">,</span> factory<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span> <span class="token operator">&#x26;&#x26;</span> <span class="token keyword">typeof</span> module <span class="token operator">===</span> <span class="token string">\'object\'</span><span class="token punctuation">)</span>\n    module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token keyword">else</span> <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> define <span class="token operator">===</span> <span class="token string">\'function\'</span> <span class="token operator">&#x26;&#x26;</span> define<span class="token punctuation">.</span>amd<span class="token punctuation">)</span>\n    <span class="token function">define</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> factory<span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token keyword">else</span> <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span><span class="token punctuation">)</span>\n    exports<span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token keyword">else</span>\n    root<span class="token punctuation">[</span><span class="token string">\'MyLibrary\'</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> self <span class="token operator">!==</span> <span class="token string">\'undefined\'</span> <span class="token operator">?</span> self <span class="token punctuation">:</span> <span class="token keyword">this</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> _entry_return_<span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>Note that omitting <code>library</code> will result in the assignment of all properties returned by the entry point be assigned directly to the root object, as documented under the <a href="#expose-via-object-assignment">object assignment section</a>. Example:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'umd\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>The output will be:</p>\n<pre><code class="hljs language-javascript"><span class="token punctuation">(</span><span class="token keyword">function</span> <span class="token function">webpackUniversalModuleDefinition</span><span class="token punctuation">(</span>root<span class="token punctuation">,</span> factory<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span> <span class="token operator">&#x26;&#x26;</span> <span class="token keyword">typeof</span> module <span class="token operator">===</span> <span class="token string">\'object\'</span><span class="token punctuation">)</span>\n    module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token keyword">else</span> <span class="token keyword">if</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> define <span class="token operator">===</span> <span class="token string">\'function\'</span> <span class="token operator">&#x26;&#x26;</span> define<span class="token punctuation">.</span>amd<span class="token punctuation">)</span>\n    <span class="token function">define</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> factory<span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token keyword">else</span> <span class="token punctuation">{</span>\n    <span class="token keyword">var</span> a <span class="token operator">=</span> <span class="token function">factory</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">for</span><span class="token punctuation">(</span><span class="token keyword">var</span> i <span class="token keyword">in</span> a<span class="token punctuation">)</span> <span class="token punctuation">(</span><span class="token keyword">typeof</span> exports <span class="token operator">===</span> <span class="token string">\'object\'</span> <span class="token operator">?</span> exports <span class="token punctuation">:</span> root<span class="token punctuation">)</span><span class="token punctuation">[</span>i<span class="token punctuation">]</span> <span class="token operator">=</span> a<span class="token punctuation">[</span>i<span class="token punctuation">]</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token keyword">typeof</span> self <span class="token operator">!==</span> <span class="token string">\'undefined\'</span> <span class="token operator">?</span> self <span class="token punctuation">:</span> <span class="token keyword">this</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> _entry_return_<span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>Since webpack 3.1.0, you may specify an object for <code>library</code> for differing names per targets:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    library<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n      root<span class="token punctuation">:</span> <span class="token string">\'MyLibrary\'</span><span class="token punctuation">,</span>\n      amd<span class="token punctuation">:</span> <span class="token string">\'my-library\'</span><span class="token punctuation">,</span>\n      commonjs<span class="token punctuation">:</span> <span class="token string">\'my-common-library\'</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'umd\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p><code>libraryTarget: \'system\'</code> - This will expose your library as a <a href="https://github.com/systemjs/systemjs/blob/master/docs/system-register.md"><code>System.register</code></a>\nmodule. This feature was first released in <a href="https://github.com/webpack/webpack/releases/tag/v4.30.0">webpack 4.30.0</a>.</p>\n<p>System modules require that a global variable <code>System</code> is present in the browser when the webpack bundle is executed. Compiling to <code>System.register</code> format allows you to <code>System.import(\'/bundle.js\')</code> without additional configuration and have your webpack bundle loaded into the System module registry.</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    libraryTarget<span class="token punctuation">:</span> <span class="token string">\'system\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Output:</p>\n<pre><code class="hljs language-javascript">System<span class="token punctuation">.</span><span class="token function">register</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>_export<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> <span class="token punctuation">{</span>\n    setters<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n    execute<span class="token punctuation">:</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      <span class="token comment">// ...</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>By adding <code>output.library</code> to configuration in addition to having <code>output.libraryTarget</code> set to <code>system</code>, the output bundle will have the library name as an argument to <code>System.register</code>:</p>\n<pre><code class="hljs language-javascript">System<span class="token punctuation">.</span><span class="token function">register</span><span class="token punctuation">(</span><span class="token string">\'my-library\'</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>_export<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">return</span> <span class="token punctuation">{</span>\n    setters<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n    execute<span class="token punctuation">:</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      <span class="token comment">// ...</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>Module proof library.</p>\n<h3 id="other-targets">Other Targets<a href="#other-targets" aria-hidden="true"><span class="icon icon-link"></span></a></h3>\n<p><code>libraryTarget: \'jsonp\'</code> - This will wrap the return value of your entry point into a jsonp wrapper.</p>\n<pre><code class="hljs language-javascript"><span class="token function">MyLibrary</span><span class="token punctuation">(</span>_entry_return_<span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>The dependencies for your library will be defined by the <a href="/configuration/externals/"><code>externals</code></a> config.</p>\n<h2 id="outputpath"><code>output.path</code><a href="#outputpath" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string: path.join(process.cwd(), \'dist\')</code></p>\n<p>The output directory as an <strong>absolute</strong> path.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    path<span class="token punctuation">:</span> path<span class="token punctuation">.</span><span class="token function">resolve</span><span class="token punctuation">(</span>__dirname<span class="token punctuation">,</span> <span class="token string">\'dist/assets\'</span><span class="token punctuation">)</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>Note that <code>[hash]</code> in this parameter will be replaced with an hash of the compilation. See the <a href="/guides/caching/">Caching guide</a> for details.</p>\n<h2 id="outputpathinfo"><code>output.pathinfo</code><a href="#outputpathinfo" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean</code></p>\n<p>Tells webpack to include comments in bundles with information about the contained modules. This option defaults to <code>true</code> in <code>development</code> and <code>false</code> in <code>production</code> <a href="/configuration/mode/">mode</a> respectively.</p>\n<blockquote class="warning">\n<p>While the data this comments can provide is very useful during development when reading the generated code, it <strong>should not</strong> be used in production.</p>\n</blockquote>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    pathinfo<span class="token punctuation">:</span> <span class="token boolean">true</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<blockquote class="tip">\n<p>It also adds some info about tree shaking to the generated bundle.</p>\n</blockquote>\n<h2 id="outputpublicpath"><code>output.publicPath</code><a href="#outputpublicpath" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'\'</code> <code>function</code></p>\n<p>This is an important option when using on-demand-loading or loading external resources like images, files, etc. If an incorrect value is specified you\'ll receive 404 errors while loading these resources.</p>\n<p>This option specifies the <strong>public URL</strong> of the output directory when referenced in a browser. A relative URL is resolved relative to the HTML page (or <code>&#x3C;base></code> tag). Server-relative URLs, protocol-relative URLs or absolute URLs are also possible and sometimes required, i. e. when hosting assets on a CDN.</p>\n<p>The value of the option is prefixed to every URL created by the runtime or loaders. Because of this <strong>the value of this option ends with <code>/</code></strong> in most cases.</p>\n<p>Simple rule: The URL of your <a href="#outputpath"><code>output.path</code></a> from the view of the HTML page.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    path<span class="token punctuation">:</span> path<span class="token punctuation">.</span><span class="token function">resolve</span><span class="token punctuation">(</span>__dirname<span class="token punctuation">,</span> <span class="token string">\'public/assets\'</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'https://cdn.example.com/assets/\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>For this configuration:</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'/assets/\'</span><span class="token punctuation">,</span>\n    chunkFilename<span class="token punctuation">:</span> <span class="token string">\'[id].chunk.js\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>A request to a chunk will look like <code>/assets/4.chunk.js</code>.</p>\n<p>A loader outputting HTML might emit something like this:</p>\n<pre><code class="hljs language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&#x3C;</span>link</span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>/assets/spinner.gif<span class="token punctuation">"</span></span> <span class="token punctuation">/></span></span></code></pre>\n<p>or when loading an image in CSS:</p>\n<pre><code class="hljs language-css"><span class="token property">background-image</span><span class="token punctuation">:</span> <span class="token url">url(/assets/spinner.gif)</span><span class="token punctuation">;</span></code></pre>\n<p>The webpack-dev-server also takes a hint from <code>publicPath</code>, using it to determine where to serve the output files from.</p>\n<p>Note that <code>[hash]</code> in this parameter will be replaced with an hash of the compilation. See the <a href="/guides/caching">Caching guide</a> for details.</p>\n<p>Examples:</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    <span class="token comment">// One of the below</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'https://cdn.example.com/assets/\'</span><span class="token punctuation">,</span> <span class="token comment">// CDN (always HTTPS)</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'//cdn.example.com/assets/\'</span><span class="token punctuation">,</span> <span class="token comment">// CDN (same protocol)</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'/assets/\'</span><span class="token punctuation">,</span> <span class="token comment">// server-relative</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'assets/\'</span><span class="token punctuation">,</span> <span class="token comment">// relative to HTML page</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'../assets/\'</span><span class="token punctuation">,</span> <span class="token comment">// relative to HTML page</span>\n    publicPath<span class="token punctuation">:</span> <span class="token string">\'\'</span><span class="token punctuation">,</span> <span class="token comment">// relative to HTML page (same directory)</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>In cases where the <code>publicPath</code> of output files can\'t be known at compile time, it can be left blank and set dynamically at runtime in the entry file using the <a href="https://stackoverflow.com/questions/12934929/what-are-free-variables">free variable</a> <code>__webpack_public_path__</code>.</p>\n<pre><code class="hljs language-javascript">__webpack_public_path__ <span class="token operator">=</span> myRuntimePublicPath<span class="token punctuation">;</span>\n\n<span class="token comment">// rest of your application entry</span></code></pre>\n<p>See <a href="https://github.com/webpack/webpack/issues/2776#issuecomment-233208623">this discussion</a> for more information on <code>__webpack_public_path__</code>.</p>\n<h2 id="outputsourcemapfilename"><code>output.sourceMapFilename</code><a href="#outputsourcemapfilename" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'[file].map[query]\'</code></p>\n<p>Configure how source maps are named. Only takes effect when <a href="/configuration/devtool/"><code>devtool</code></a> is set to <code>\'source-map\'</code>, which writes an output file.</p>\n<p>The <code>[name]</code>, <code>[id]</code>, <code>[hash]</code> and <code>[chunkhash]</code> substitutions from <a href="#outputfilename"><code>output.filename</code></a> can be used. In addition to those, you can use substitutions listed below. The <code>[file]</code> placeholder is replaced with the filename of the original file. We recommend <strong>only using the <code>[file]</code> placeholder</strong>, as the other placeholders won\'t work when generating SourceMaps for non-chunk files.</p>\n<table>\n<thead>\n<tr>\n<th>Template</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[file]<p class="description mobile">The module filename</p></p></div></td>\n<td class="description desktop">The module filename</td>\n</tr>\n<tr>\n<td><div class="title"><p>Template</p><p>Description</p></div>\n<div class="content"><p>[filebase]<p class="description mobile">The module <a href="https://nodejs.org/api/path.html#path_path_basename_path_ext">basename</a></p></p></div></td>\n<td class="description desktop">The module \n<a href="https://nodejs.org/api/path.html#path_path_basename_path_ext">basename</a></td>\n</tr>\n</tbody>\n</table>\n<h2 id="outputsourceprefix"><code>output.sourcePrefix</code><a href="#outputsourceprefix" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>string = \'\'</code></p>\n<p>Change the prefix for each line in the output bundles.</p>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    sourcePrefix<span class="token punctuation">:</span> <span class="token string">\'\\t\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<blockquote class="tip">\n<p>Using some kind of indentation makes bundles look prettier, but will cause issues with multi-line strings.</p>\n</blockquote>\n<blockquote class="tip">\n<p>Typically you don\'t need to change <code>output.sourcePrefix</code>.</p>\n</blockquote>\n<h2 id="outputstrictmoduleexceptionhandling"><code>output.strictModuleExceptionHandling</code><a href="#outputstrictmoduleexceptionhandling" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean = false</code></p>\n<p>Tell webpack to remove a module from the module instance cache (<code>require.cache</code>) if it throws an exception when it is <code>require</code>d.</p>\n<p>It defaults to <code>false</code> for performance reasons.</p>\n<p>When set to <code>false</code>, the module is not removed from cache, which results in the exception getting thrown only on the first <code>require</code> call (making it incompatible with node.js).</p>\n<p>For instance, consider <code>module.js</code>:</p>\n<pre><code class="hljs language-javascript"><span class="token keyword">throw</span> <span class="token keyword">new</span> <span class="token class-name">Error</span><span class="token punctuation">(</span><span class="token string">\'error\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<p>With <code>strictModuleExceptionHandling</code> set to <code>false</code>, only the first <code>require</code> throws an exception:</p>\n<pre><code class="hljs language-javascript"><span class="token comment">// with strictModuleExceptionHandling = false</span>\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'module\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// &#x3C;- throws</span>\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'module\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// &#x3C;- doesn\'t throw</span></code></pre>\n<p>Instead, with <code>strictModuleExceptionHandling</code> set to <code>true</code>, all <code>require</code>s of this module throw an exception:</p>\n<pre><code class="hljs language-javascript"><span class="token comment">// with strictModuleExceptionHandling = true</span>\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'module\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// &#x3C;- throws</span>\n<span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'module\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// &#x3C;- also throws</span></code></pre>\n<h2 id="outputumdnameddefine"><code>output.umdNamedDefine</code><a href="#outputumdnameddefine" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean</code></p>\n<p>When using <code>libraryTarget: "umd"</code>, setting <code>output.umdNamedDefine</code> to <code>true</code> will name the AMD module of the UMD build. Otherwise an anonymous <code>define</code> is used.</p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    umdNamedDefine<span class="token punctuation">:</span> <span class="token boolean">true</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<h2 id="outputfutureemitassets"><code>output.futureEmitAssets</code><a href="#outputfutureemitassets" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean = false</code></p>\n<p>Tells webpack to use the future version of asset emitting logic, which allows freeing memory of assets after emitting. It could break plugins which assume that assets are still readable after they were emitted.</p>\n<blockquote class="warning">\n<p><code>output.futureEmitAssets</code> option will be removed in webpack v5.0.0 and this behaviour will become the new default.</p>\n</blockquote>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  output<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    futureEmitAssets<span class="token punctuation">:</span> <span class="token boolean">true</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n'}}]);